import React from "react";

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  console.log(ratings);
  return (
    <div className="rating">
      <span>
        <i
          className={value >= 1 ? "fa-regular fa-star" : "fa-solid fa-star"}
        ></i>
      </span>

      {ratings.map((j) => {
        <span>
          <i
            className={
              value - j >= 1
                ? "fa-solid fa-start"
                : value - j >= 0.5
                ? "fa-solid fa-star-half-alt"
                : "fa-regular fa-star"
            }
          ></i>
        </span>;
      })}

      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
